ng this disease, and members of society who are vulnerable - and continue to do all we can to stop the spread of coronavirus. \n \nBy doing the right thing and following the rules, you are helping to save lives.", "I want to say thank you, from the bottom of my heart, to all carers in the UK helping us through this pandemic. \n \nWhether you work as a carer, or are caring for someone at home, your compassion and strength at this time is a beacon of hope for us all. \n \n #CarersWeek", "People have a right to protest peacefully & while observing social distancing but they have no right to attack the police. These demonstrations have been subverted by thuggery - and they are a betrayal of the cause they purport to serve. Those responsible will be held to account.", "If you have coronavirus symptoms (a high temperature, a new continuous cough, or a loss or change to sense of taste or smell) you need to self-isolate and get tested.\n\nThere is plenty of capacity and anyone with symptoms is eligible. Order a test from http://nhs.uk/coronavirus   1/2", "Whilst we are all rightly focused on beating coronavirus, we cannot lose sight of the need to protect our people and our planet from the devastating threat of climate change and biodiversity loss if nothing is done. 1/4", "At the start of #PrideMonth, I want to thank those in the LGBT community and campaigners for their inspirational work, in fighting tirelessly to overcome the prejudices many face. \n\nYour contribution has helped shape a better future for people in the UK and around the world.", "From today, in England, you will be allowed to meet up to five friends in public outdoor places or in your garden. This will be a moment of joy and relief for many. \n\nPlease remember to keep 2 metres away from those you don \u06eat live with, and wash your hands regularly.", "Have you got symptoms of coronavirus? \n\nIf so, you must get tested. Click below ", "On International Day of UN Peacekeepers, I want to pay my tribute to the Blue Helmets and many others who do so much to bring peace in areas of the world torn apart by conflict. \n\n#PKDay", "From Monday we will allow up to six people to meet outside, provided those from different households continue strictly to observe social distancing rules by staying two metres apart. (1/3)", "The NHS Test and Trace service will now start emailing, phoning and texting people who have been in close contact with confirmed coronavirus cases.\n\nThe team will call from: 0300 013 5000\nOR send a text message from    NHS \u06dd", "Seven years on from his murder on a London street, we remember Fusilier Lee Rigby. On this sad day, my thoughts are with his family, friends and colleagues.", "Today, on the third anniversary of the Manchester Arena attack, we remember the 22 lives which were so cruelly taken. My thoughts are with all of those grieving for the loss of their loved ones.", "I know this has been a tough time for so many people. Thank you for all of the sacrifices you have made. \n\nWe are past the peak, and I \u06eam confident that if we continue to follow the rules and work together, we will beat this virus and be reunited with our friends and family soon.", "The common sense of the British people got us through that first phase of this disease. I am absolutely confident it will get us through the next as well. #StayAlert", "There could be no greater mistake than to jeopardise everything we have striven to achieve by proceeding too far and too fast. \n\nWe must all continue to #StayAlert, so that we can control the virus and save lives.", "We can control the virus if we all #StayAlert:\n\n Stay home as much as possible\n Work from home if you can\n Limit contact with others \n Keep your distance if you go out\n Wash your hands\n Self-isolate if you or anyone in your household has symptoms", "Thank you for all you are doing to protect our NHS and save lives. \n\nThis bank holiday weekend, please stay at home, so we don \u06eat undo everything that \u06eas been done so far.", "We are past the peak of this disease. But we can \u06eat get complacent.\n \nPlease continue to follow the rules on social distancing and stay at home to save lives. \n \n#StayHomeSaveLives", "This has been a difficult time for our country, but if we all continue to follow the rules and protect our NHS, then we can beat this virus together. \n\n#StayHomeSaveLives", "Millions of people across this country have been doing the right thing: going through the hardship of self-isolation, faithfully, patiently, with thought and care for others as well as for themselves. \n \nThank you for all you are doing, and please keep going. \n\n#StayHomeSaveLives", "Thank you to all the midwives across the UK who continue to show extraordinary kindness and courage during these challenging times. Your compassion, care and expertise are needed now more than ever. #IDM2020", "The race to discover the vaccine to defeat this virus is not a competition between countries, but the most urgent shared endeavour of our lifetimes.\n\nIt \u06eas humanity against the virus - we are in this together, and together we will prevail.", "There are five key tests that we must satisfy before we can adjust the current measures. - 1/6", "I can confirm that we are past the peak of this disease. \n\nWe are past the peak and we are on the downward slope.\n \nAnd we have so many reasons to be hopeful for the long term. \n\nBut we can only defeat coronavirus by our collective discipline and working together.", "1/3: I know how hard and how stressful it has been to give up even temporarily those ancient and basic freedoms, not seeing friends, not seeing loved ones, working from home, managing the kids, worrying about your job and your firm.", "Last night, on the advice of my doctor, I went into hospital for some routine tests as I \u06eam still experiencing coronavirus symptoms. I \u06eam in good spirits and keeping in touch with my team, as we work together to fight this virus and keep everyone safe.", "Thank you to everyone who is saving lives by staying at home this weekend. \n\nI know it's tough, but if we all work together and follow the guidance we will beat #coronavirus.\n\n#StayHomeSaveLives", "I have just spoken to @Keir_Starmer & congratulated him on becoming Labour leader. We agreed on the importance of all party leaders continuing to work constructively together through this national emergency. I have invited him and other opposition leaders to a briefing next week.", "This country has made a huge effort, a huge sacrifice, and done absolutely brilliantly well in delaying the spread of the virus. \n\nBut in this fine weather, please don't be tempted to break the regulations. I urge everyone to stay at home, protect the NHS and save lives.", "Yesterday's data showed more people were using transport than in previous days. \n\nPlease do not leave your house unless absolutely necessary. It really will save lives. \n\n#StayHomeSavesLives", "I'm staying at home to protect our NHS and save lives.\n\nIf we all follow government advice, we can beat #coronavirus together.\n\n#StayHomeSaveLives", "Thank you to the 20,000 former staff coming back to the NHS.\n\nAnd thank you to the 750,000 people who have volunteered to help vulnerable people through this crisis.\n\nWe will get through it together.\n\n#Coronavirus #StayHomeSaveLives", "We \u06eare taking the right measures at the right time. It is vital to slow the spread of the disease, so stay at home, protect the NHS and save lives. #StayHomeSaveLives", "Thank you to the 11,788 former NHS staff who have answered the call to support the health service as it responds to #coronavirus.\n\nNow people must stay at home to support you, so that you can be there to support us in our hour of need. #StayHomeSaveLives", "If you don \u06eat follow these instructions, you are putting people \u06eas lives at risk: \n\nYou must stay at home to protect our NHS and save lives. \n\n#StayHomeSaveLives", "We will get through this together, and we will beat the virus. \n\nTo win this fight, we need everyone to follow our advice: as far as possible, we want you to stay at home. The more effectively everyone does this, the faster this country will recover.\n\n#StayHomeSaveLives", "We can send #coronavirus packing in this country, but only if we take the required steps to reduce the peak.\n\nOnce we \u06eave achieved that, then the scientific progress that we are making will really come into play.\n\n1/5", "I want to say a huge thank you on behalf of the whole country to everyone working in our NHS, of every specialism and role, in our fight against the coronavirus pandemic. We \u06eave never needed you more than we do today.", "The government and the NHS have updated the advice on #COVID19.\n \nIf you have: a new continuous cough OR a high temperature (37.8 degrees or higher), you should stay at home for 7 days.\n \nRead the full guidance now:\n http://NHS.uk/coronavirus  ", "It is with deep sadness that I learned that a UK soldier was killed in the attack at the Taji military base last night. My thoughts go out to their loved ones at this extremely difficult time.", "Help protect yourself and others.\n \nTap the link below to share official #NHS advice on #coronavirus with your family and friends via @WhatsApp \n\nShare now ", "Today, two years on from the chemical attack in Salisbury, my thoughts remain with all those impacted. It is heartening to see the historic city welcoming visitors and looking to the future, thanks to the strength and character of the community.", "I'm deeply saddened to hear of the attack at the London Central Mosque. It's so awful that this should happen, especially in a place of worship. My thoughts are with the victim and all those affected.", "My thoughts are with the people of Germany as they grieve those lost in the terrible attack in Hanau last night. \n\nThe UK stands with our German friends against this racist assault on our values.", "This morning I spoke to Chinese President Xi to express my sympathy and support for those affected by the coronavirus outbreak. The UK government has donated vital medical equipment to the region and we will continue to offer our assistance. (1/2)", ".@KarenPierceUN is an outstanding and accomplished diplomat and I can think of no better person to drive forward our hugely important relationship with the United States at this time. I \u06eam delighted she \u06eall be representing us in Washington.", "Thank you to all emergency services responding to the incident in Streatham, which the police have now declared as terrorism-related. My thoughts are with the injured and all those affected.", "Thank you to @SteveBarclay, @LordCallanan, @JamesDuddridge and to everyone at DExEU for all of your hard work and dedication in getting Brexit delivered.", "Tonight we have left the EU - an extraordinary turning point in the life of this country. Let us come together now to make the most of all the opportunities Brexit will bring - and let \u06eas unleash the potential of the whole UK. ", " What: The Prime Minister's Address to the Nation.\n When: 10pm tonight.\n Where: @BorisJohnson's Facebook page.\n\n#BrexitDay", "This Australia Day, I want all our Aussie friends to know that we Brits are thinking of you. Your resilience & positive spirit has been an inspiration to us all. \n \nOur two nations share a very special friendship that I hope will continue to strengthen. Happy Australia Day.", "Seamus Mallon made an extraordinary contribution to democracy and peace in Northern Ireland. I want to express my sincere condolences to his daughter Orla, to his family and friends and to the SDLP.", "The Withdrawal Agreement has received  Royal Assent and is now law. We will leave the EU on January 31st ", "RIP Sir Roger Scruton. We have lost the greatest modern conservative thinker - who not only had the guts to say what he thought but said it beautifully.", "This is a great step forwards for the people of Northern Ireland and for restoring public confidence in stable devolved Government and delivering much needed reforms to public services.", "\"My thoughts are with the prison staff who were injured in the suspected terrorist incident at HMP Whitemoor and I would like to thank them, and the emergency services, for their courageous response.  We owe those who keep us safe a huge debt of gratitude.\"     PM  @BorisJohnson", "Our hearts go out to all those in Australia affected by these devastating fires. I have been in touch with PM @ScottMorrisonMP to offer any assistance we can provide. We stand with you at this very difficult time. ", "We are going to level up and unite our country. We are going to get Brexit done and deliver the change that people voted for. And we are going to protect and invest in our amazing NHS.", "We will be out of the EU on 31st January. We will invest billions more in our NHS. We will level up and unite our country. #PeoplesGovernment", "Wishing you and your family a very Merry Christmas", "The second reading of the Withdrawal Agreement Bill has passed - which means we are one step closer to getting Brexit done ", "We will be out of the EU on 31st January. We will invest billions more in our NHS. We will level up and unite our country. #PeoplesGovernment", "Let's unite this country, let's spread opportunity to every corner of the UK, with superb education, superb infrastructure, and technology.\n\nLet's get this done and move forward.", "We are going to deliver a Parliament that works for the people.", "I say thank you for the trust you have placed in us, and in me. \n\nWe will work round the clock to repay your trust and to deliver on your priorities with a parliament that works for you.", "Let \u06eas not go back to the broken parliament we had before this election was called. \n\nLet \u06eas move forward with a majority Conservative government that can get things done.", "Vote Conservative to get Brexit done! ", "We are a great country, and we can be greater still. \n\nVote today to get Brexit done. \n\nVote Conservative.", "Vote Conservative today to get Brexit done!", "Vote to get Brexit done and unleash Britain \u06eas potential. Vote Conservative.", "We must respect the result of the EU referendum. #VoteConservative", "Today is our chance to get Brexit done. Vote Conservative.", "If there \u06eas a Conservative majority government, we can deliver the change people voted for. We can get Brexit done. We can make a decisive break with the dither and indecision of the last three and a half years. We can unleash Britain \u06eas potential.", "Let \u06eas get Brexit done and get on with spreading opportunity and hope across the whole UK and let \u06eas unleash the potential of this country.", "We have one more day. Make sure you have your voice heard. Vote to honour the promises of the past and for a brighter vision of the future. Vote Conservative tomorrow.", "There are only two more days to go. Let \u06eas get Brexit done!", "We \u06eare having this election because Parliament couldn \u06eat get anything done. Only the Conservatives can get Brexit done and get Parliament working again, on the issues that matter to you.", "Jonathan Ashworth is saying what hundreds of Labour candidates and millions of voters are thinking. Jeremy Corbyn is unfit to be PM because he is blocking Brexit. \n\nOnly a vote for @Conservatives will break the deadlock & #GetBrexitDone so we can focus on the people \u06eas priorities.", "Let \u06eas get Brexit done. Let \u06eas get on with the country \u06eas priorities and unleash the potential of the whole of the UK.", "Let's get Brexit done!", "Let's get Brexit done!", "We live in a great country, and we can make it greater still. \n\nTogether we \u06eall end the uncertainty and get Brexit done.", "We can \u06eat afford another chaotic hung parliament     with Jeremy Corbyn in charge of nothing except more arguments. \n\nSo let \u06eas get Brexit done. Let \u06eas get on with the country \u06eas priorities and unleash the potential of the whole of the UK.", "As Prime Minister, I will always back our security services, our police and our troops. I will give them the funding and support they need. #BBCDebate", "We will toughen up sentencing for terrorists     increasing the minimum sentence for serious offenders and ending early release completely #BBCDebate", "If you work hard to provide for your family and pay your taxes, you should be able to keep a bit more of what you earn.\n \nA Conservative government will keep your taxes low - not take more away. #BBCDebate", "We \u06eave got 6 days to get Brexit done! Let \u06eas do it.", "Folks, we have just six days to get Brexit done and move this country forward. Together, we \u06eall get there.", "Let \u06eas get Brexit done and focus our hearts and minds on the priorities of the British people.", "We will get Brexit done.", "Let's get Brexit done ", "Let \u06eas get Brexit done and deliver on the priorities of the British people.", "Under my leadership, a majority Conservative government will get Brexit done, invest more money in our public services, get tough on crime, back our Armed Forces and strengthen our economy.", "Folks, every vote is going to count at this election. You can use yours to put an end to the uncertainty and to get Brexit done!", "If there \u06eas a Conservative majority government, we can deliver the change people voted for. We can get Brexit done. We can make a decisive break with the dither and indecision of the last three and a half years. We can unleash Britain \u06eas potential.", "The only way we can break the deadlock in parliament - and get Brexit done - is with a majority Conservative government.", "Let \u06eas get Brexit done so we can focus our hearts and our minds on the priorities of the British people.", "We \u06eave got 8 days to get Brexit done and unleash Britain \u06eas potential!", "Getting Brexit done \n50,000 more nurses \n50 million more GP surgery appointments\n20,000 more police\nTougher sentencing for criminals\nAn Australian style, points-based immigration system\nTackling climate change \nLowering your taxes \nStrengthening our economy", "We \u06eave got the plan to get Brexit done and invest in our NHS, schools and police. \n\nWe will get Parliament working again on the issues that matter to you.", "Together we can get Brexit done. \nVote Conservative on December 12th.", "Folks, we \u06eare having this election because Parliament simply wasn \u06eat working - it was stuck in endless dither and delay. \n\nThe only way we can move forward now is to get Brexit done with a majority Conservative government.", "We have 9 days to get Brexit done and unleash the potential of the whole UK!", "Let \u06eas get Brexit done and get to work on the things that matter to you.", "We can \u06eat afford another chaotic hung parliament     with Jeremy Corbyn in charge of nothing except more arguments. So let \u06eas get Brexit done. Let \u06eas get on with the country \u06eas priorities and unleash the potential of the whole of the UK.", "We \u06eare having this election because Parliament could not get anything done. It was paralysed. \n\nIt \u06eas time for us to take decisive action and to get Brexit done, so that we can get Parliament working again on the issues that matter to you.", "Getting Brexit done \n20,000 new police \nMore money for our NHS \nMore money for every pupil \nAn Australian style, points-based immigration system \n\n#VoteConservative #ITVDebate", "The terrible Khan case has highlighted a complicated area of law. There have been many inaccuracies reported about this case over the last 24 hours. Here are the details (1/16)", "Happy #StAndrewsDay to all Scots across Scotland, the UK and the world today. \n\nI'm proud to be the Prime Minister of the entire United Kingdom, including Scotland.", "I want to thank the emergency services and members of the public for their immense bravery in responding to this suspected terrorist attack at London Bridge.\n \nThis is an appalling incident and all my thoughts are with the victims and their families.", "\"I \u06eam being kept updated on the incident at London Bridge and want to thank the police and all emergency services for their immediate response.\"     Prime Minister Boris Johnson", "We can \u06eat afford another chaotic hung parliament     with Jeremy Corbyn in charge of nothing except more arguments. \n\nSo let \u06eas get Brexit done. Let \u06eas get on with the country \u06eas priorities and unleash the potential of the whole of the UK.", "Back me to get Brexit done - vote Conservative on December 12th!"], "targets": null, "hoffset": 10, "voffset": 10}]});

.8243286019188341, 0.6795913385312966], [0.1519238691768271, 0.17177208224139978], [0.7572183393494534, 0.8859071445932725], [0.5633396889863272, 0.8715995432101273], [0.6303362376977781, 0.8520481632439209], [0.6516750789940171, 0.8598463841856282], [0.7407502131791872, 0.839848163607252], [0.6248038172915626, 0.8581149639853972], [0.3882849697844002, 0.055231903833993005], [0.1073150260316802, 0.40617187644497793], [0.2742454515083549, 0.4016827777982032], [0.3862709147682434, 0.543457627193758], [0.6303362376977781, 0.8520481632439209], [0.6164271277697702, 0.8890329899550878], [0.548982245053989, 0.10577955126323525], [0.2842535598877396, 0.33008546412970324], [0.5918689035982749, 0.8156784667469426], [0.11335975919787833, 0.09444870197127933], [0.6664320436999387, 0.8164772103313762], [0.6779950366154263, 0.8194200974225945], [0.7136135994565893, 0.637379721532738], [0.5092993081781051, 0.34604819418927507], [0.17508034064869915, 0.02279749533151856], [0.39318102336665917, 0.46821478595214305], [0.3198157761919401, 0.9122882678059198], [0.20332965885767484, 0.7452034997792304], [0.17453087478287532, 0.6075959179606152], [0.7136135994565893, 0.637379721532738], [0.5918689035982749, 0.8156784667469426]]}, "id": "el9972140209047263792", "plugins": [{"type": "reset"}, {"type": "zoom", "button": true, "enabled": false}, {"type": "boxzoom", "button": true, "enabled": false}, {"type": "htmltooltip", "id": "el9972140207835963696", "labels": ["Racist thuggery has no place on our streets. Anyone attacking the police will be met with full force of the law. These marches & protests have been subverted by violence and breach current guidelines. Racism has no part in the UK and we must work together to make that a reality.", "The statue of Winston Churchill in Parliament Square is a permanent reminder of his achievement in saving this country     and the whole of Europe     from a fascist and racist tyranny. 1/8", "We must all continue to remember those on the frontline battling this disease, and members of society who are vulnerable - and continue to do all we can to stop the spread of coronavirus. \n \nBy doing the right thing and following the rules, you are helping to save lives.", "I want to say thank you, from the bottom of my heart, to all carers in the UK helping us through this pandemic. \n \nWhether you work as a carer, or are caring for someone at home, your compassion and strength at this time is a beacon of hope for us all. \n \n #CarersWeek", "People have a right to protest peacefully & while observing social distancing but they have no right to attack the police. These demonstrations have been subverted by thuggery - and they are a betrayal of the cause they purport to serve. Those responsible will be held to account.", "If you have coronavirus symptoms (a high temperature, a new continuous cough, or a loss or change to sense of taste or smell) you need to self-isolate and get tested.\n\nThere is plenty of capacity and anyone with symptoms is eligible. Order a test from http://nhs.uk/coronavirus   1/2", "Whilst we are all rightly focused on beating coronavirus, we cannot lose sight of the need to protect our people and our planet from the devastating threat of climate change and biodiversity loss if nothing is done. 1/4", "At the start of #PrideMonth, I want to thank those in the LGBT community and campaigners for their inspirational work, in fighting tirelessly to overcome the prejudices many face. \n\nYour contribution has helped shape a better future for people in the UK and around the world.", "From today, in England, you will be allowed to meet up to five friends in public outdoor places or in your garden. This will be a moment of joy and relief for many. \n\nPlease remember to keep 2 metres away from those you don \u06eat live with, and wash your hands regularly.", "Have you got symptoms of coronavirus? \n\nIf so, you must get tested. Click below ", "On International Day of UN Peacekeepers, I want to pay my tribute to the Blue Helmets and many others who do so much to bring peace in areas of the world torn apart by conflict. \n\n#PKDay", "From Monday we will allow up to six people to meet outside, provided those from different households continue strictly to observe social distancing rules by staying two metres apart. (1/3)", "The NHS Test and Trace service will now start emailing, phoning and texting people who have been in close contact with confirmed coronavirus cases.\n\nThe team will call from: 0300 013 5000\nOR send a text message from    NHS \u06dd", "Seven years on from his murder on a London street, we remember Fusilier Lee Rigby. On this sad day, my thoughts are with his family, friends and colleagues.", "Today, on the third anniversary of the Manchester Arena attack, we remember the 22 lives which were so cruelly taken. My thoughts are with all of those grieving for the loss of their loved ones.", "I know this has been a tough time for so many people. Thank you for all of the sacrifices you have made. \n\nWe are past the peak, and I \u06eam confident that if we continue to follow the rules and work together, we will beat this virus and be reunited with our friends and family soon.", "The common sense of the British people got us through that first phase of this disease. I am absolutely confident it will get us through the next as well. #StayAlert", "There could be no greater mistake than to jeopardise everything we have striven to achieve by proceeding too far and too fast. \n\nWe must all continue to #StayAlert, so that we can control the virus and save lives.", "We can control the virus if we all #StayAlert:\n\n Stay home as much as possible\n Work from home if you can\n Limit contact with others \n Keep your distance if you go out\n Wash your hands\n Self-isolate if you or anyone in your household has symptoms", "Thank you for all you are doing to protect our NHS and save lives. \n\nThis bank holiday weekend, please stay at home, so we don \u06eat undo everything that \u06eas been done so far.", "We are past the peak of this disease. But we can \u06eat get complacent.\n \nPlease continue to follow the rules on social distancing and stay at home to save lives. \n \n#StayHomeSaveLives", "This has been a difficult time for our country, but if we all continue to follow the rules and protect our NHS, then we can beat this virus together. \n\n#StayHomeSaveLives", "Millions of people across this country have been doing the right thing: going through the hardship of self-isolation, faithfully, patiently, with thought and care for others as well as for themselves. \n \nThank you for all you are doing, and please keep going. \n\n#StayHomeSaveLives", "Thank you to all the midwives across the UK who continue to show extraordinary kindness and courage during these challenging times. Your compassion, care and expertise are needed now more than ever. #IDM2020", "The race to discover the vaccine to defeat this virus is not a competition between countries, but the most urgent shared endeavour of our lifetimes.\n\nIt \u06eas humanity against the virus - we are in this together, and together we will prevail.", "There are five key tests that we must satisfy before we can adjust the current measures. - 1/6", "I can confirm that we are past the peak of this disease. \n\nWe are past the peak and we are on the downward slope.\n \nAnd we have so many reasons to be hopeful for the long term. \n\nBut we can only defeat coronavirus by our collective discipline and working together.", "1/3: I know how hard and how stressful it has been to give up even temporarily those ancient and basic freedoms, not seeing friends, not seeing loved ones, working from home, managing the kids, worrying about your job and your firm.", "Last night, on the advice of my doctor, I went into hospital for some routine tests as I \u06eam still experiencing coronavirus symptoms. I \u06eam in good spirits and keeping in touch with my team, as we work together to fight this virus and keep everyone safe.", "Thank you to everyone who is saving lives by staying at home this weekend. \n\nI know it's tough, but if we all work together and follow the guidance we will beat #coronavirus.\n\n#StayHomeSaveLives", "I have just spoken to @Keir_Starmer & congratulated him on becoming Labour leader. We agreed on the importance of all party leaders continuing to work constructively together through this national emergency. I have invited him and other opposition leaders to a briefing next week.", "This country has made a huge effort, a huge sacrifice, and done absolutely brilliantly well in delaying the spread of the virus. \n\nBut in this fine weather, please don't be tempted to break the regulations. I urge everyone to stay at home, protect the NHS and save lives.", "Yesterday's data showed more people were using transport than in previous days. \n\nPlease do not leave your house unless absolutely necessary. It really will save lives. \n\n#StayHomeSavesLives", "I'm staying at home to protect our NHS and save lives.\n\nIf we all follow government advice, we can beat #coronavirus together.\n\n#StayHomeSaveLives", "Thank you to the 20,000 former staff coming back to the NHS.\n\nAnd thank you to the 750,000 people who have volunteered to help vulnerable people through this crisis.\n\nWe will get through it together.\n\n#Coronavirus #StayHomeSaveLives", "We \u06eare taking the right measures at the right time. It is vital to slow the spread of the disease, so stay at home, protect the NHS and save lives. #StayHomeSaveLives", "Thank you to the 11,788 former NHS staff who have answered the call to support the health service as it responds to #coronavirus.\n\nNow people must stay at home to support you, so that you can be there to support us in our hour of need. #StayHomeSaveLives", "If you don \u06eat follow these instructions, you are putting people \u06eas lives at risk: \n\nYou must stay at home to protect our NHS and save lives. \n\n#StayHomeSaveLives", "We will get through this together, and we will beat the virus. \n\nTo win this fight, we need everyone to follow our advice: as far as possible, we want you to stay at home. The more effectively everyone does this, the faster this country will recover.\n\n#StayHomeSaveLives", "We can send #coronavirus packing in this country, but only if we take the required steps to reduce the peak.\n\nOnce we \u06eave achieved that, then the scientific progress that we are making will really come into play.\n\n1/5", "I want to say a huge thank you on behalf of the whole country to everyone working in our NHS, of every specialism and role, in our fight against the coronavirus pandemic. We \u06eave never needed you more than we do today.", "The government and the NHS have updated the advice on #COVID19.\n \nIf you have: a new continuous cough OR a high temperature (37.8 degrees or higher), you should stay at home for 7 days.\n \nRead the full guidance now:\n http://NHS.uk/coronavirus  ", "It is with deep sadness that I learned that a UK soldier was killed in the attack at the Taji military base last night. My thoughts go out to their loved ones at this extremely difficult time.", "Help protect yourself and others.\n \nTap the link below to share official #NHS advice on #coronavirus with your family and friends via @WhatsApp \n\nShare now ", "Today, two years on from the chemical attack in Salisbury, my thoughts remain with all those impacted. It is heartening to see the historic city welcoming visitors and looking to the future, thanks to the strength and character of the community.", "I'm deeply saddened to hear of the attack at the London Central Mosque. It's so awful that this should happen, especially in a place of worship. My thoughts are with the victim and all those affected.", "My thoughts are with the people of Germany as they grieve those lost in the terrible attack in Hanau last night. \n\nThe UK stands with our German friends against this racist assault on our values.", "This morning I spoke to Chinese President Xi to express my sympathy and support for those affected by the coronavirus outbreak. The UK government has donated vital medical equipment to the region and we will continue to offer our assistance. (1/2)", ".@KarenPierceUN is an outstanding and accomplished diplomat and I can think of no better person to drive forward our hugely important relationship with the United States at this time. I \u06eam delighted she \u06eall be representing us in Washington.", "Thank you to all emergency services responding to the incident in Streatham, which the police have now declared as terrorism-related. My thoughts are with the injured and all those affected.", "Thank you to @SteveBarclay, @LordCallanan, @JamesDuddridge and to everyone at DExEU for all of your hard work and dedication in getting Brexit delivered.", "Tonight we have left the EU - an extraordinary turning point in the life of this country. Let us come together now to make the most of all the opportunities Brexit will bring - and let \u06eas unleash the potential of the whole UK. ", " What: The Prime Minister's Address to the Nation.\n When: 10pm tonight.\n Where: @BorisJohnson's Facebook page.\n\n#BrexitDay", "This Australia Day, I want all our Aussie friends to know that we Brits are thinking of you. Your resilience & positive spirit has been an inspiration to us all. \n \nOur two nations share a very special friendship that I hope will continue to strengthen. Happy Australia Day.", "Seamus Mallon made an extraordinary contribution to democracy and peace in Northern Ireland. I want to express my sincere condolences to his daughter Orla, to his family and friends and to the SDLP.", "The Withdrawal Agreement has received  Royal Assent and is now law. We will leave the EU on January 31st ", "RIP Sir Roger Scruton. We have lost the greatest modern conservative thinker - who not only had the guts to say what he thought but said it beautifully.", "This is a great step forwards for the people of Northern Ireland and for restoring public confidence in stable devolved Government and delivering much needed reforms to public services.", "\"My thoughts are with the prison staff who were injured in the suspected terrorist incident at HMP Whitemoor and I would like to thank them, and the emergency services, for their courageous response.  We owe those who keep us safe a huge debt of gratitude.\"     PM  @BorisJohnson", "Our hearts go out to all those in Australia affected by these devastating fires. I have been in touch with PM @ScottMorrisonMP to offer any assistance we can provide. We stand with you at this very difficult time. ", "We are going to level up and unite our country. We are going to get Brexit done and deliver the change that people voted for. And we are going to protect and invest in our amazing NHS.", "We will be out of the EU on 31st January. We will invest billions more in our NHS. We will level up and unite our country. #PeoplesGovernment", "Wishing you and your family a very Merry Christmas", "The second reading of the Withdrawal Agreement Bill has passed - which means we are one step closer to getting Brexit done ", "We will be out of the EU on 31st January. We will invest billions more in our NHS. We will level up and unite our country. #PeoplesGovernment", "Let's unite this country, let's spread opportunity to every corner of the UK, with superb education, superb infrastructure, and technology.\n\nLet's get this done and move forward.", "We are going to deliver a Parliament that works for the people.", "I say thank you for the trust you have placed in us, and in me. \n\nWe will work round the clock to repay your trust and to deliver on your priorities with a parliament that works for you.", "Let \u06eas not go back to the broken parliament we had before this election was called. \n\nLet \u06eas move forward with a majority Conservative government that can get things done.", "Vote Conservative to get Brexit done! ", "We are a great country, and we can be greater still. \n\nVote today to get Brexit done. \n\nVote Conservative.", "Vote Conservative today to get Brexit done!", "Vote to get Brexit done and unleash Britain \u06eas potential. Vote Conservative.", "We must respect the result of the EU referendum. #VoteConservative", "Today is our chance to get Brexit done. Vote Conservative.", "If there \u06eas a Conservative majority government, we can deliver the change people voted for. We can get Brexit done. We can make a decisive break with the dither and indecision of the last three and a half years. We can unleash Britain \u06eas potential.", "Let \u06eas get Brexit done and get on with spreading opportunity and hope across the whole UK and let \u06eas unleash the potential of this country.", "We have one more day. Make sure you have your voice heard. Vote to honour the promises of the past and for a brighter vision of the future. Vote Conservative tomorrow.", "There are only two more days to go. Let \u06eas get Brexit done!", "We \u06eare having this election because Parliament couldn \u06eat get anything done. Only the Conservatives can get Brexit done and get Parliament working again, on the issues that matter to you.", "Jonathan Ashworth is saying what hundreds of Labour candidates and millions of voters are thinking. Jeremy Corbyn is unfit to be PM because he is blocking Brexit. \n\nOnly a vote for @Conservatives will break the deadlock & #GetBrexitDone so we can focus on the people \u06eas priorities.", "Let \u06eas get Brexit done. Let \u06eas get on with the country \u06eas priorities and unleash the potential of the whole of the UK.", "Let's get Brexit done!", "Let's get Brexit done!", "We live in a great country, and we can make it greater still. \n\nTogether we \u06eall end the uncertainty and get Brexit done.", "We can \u06eat afford another chaotic hung parliament     with Jeremy Corbyn in charge of nothing except more arguments. \n\nSo let \u06eas get Brexit done. Let \u06eas get on with the country \u06eas priorities and unleash the potential of the whole of the UK.", "As Prime Minister, I will always back our security services, our police and our troops. I will give them the funding and support they need. #BBCDebate", "We will toughen up sentencing for terrorists     increasing the minimum sentence for serious offenders and ending early release completely #BBCDebate", "If you work hard to provide for your family and pay your taxes, you should be able to keep a bit more of what you earn.\n \nA Conservative government will keep your taxes low - not take more away. #BBCDebate", "We \u06eave got 6 days to get Brexit done! Let \u06eas do it.", "Folks, we have just six days to get Brexit done and move this country forward. Together, we \u06eall get there.", "Let \u06eas get Brexit done and focus our hearts and minds on the priorities of the British people.", "We will get Brexit done.", "Let's get Brexit done ", "Let \u06eas get Brexit done and deliver on the priorities of the British people.", "Under my leadership, a majority Conservative government will get Brexit done, invest more money in our public services, get tough on crime, back our Armed Forces and strengthen our economy.", "Folks, every vote is going to count at this election. You can use yours to put an end to the uncertainty and to get Brexit done!", "If there \u06eas a Conservative majority government, we can deliver the change people voted for. We can get Brexit done. We can make a decisive break with the dither and indecision of the last three and a half years. We can unleash Britain \u06eas potential.", "The only way we can break the deadlock in parliament - and get Brexit done - is with a majority Conservative government.", "Let \u06eas get Brexit done so we can focus our hearts and our minds on the priorities of the British people.", "We \u06eave got 8 days to get Brexit done and unleash Britain \u06eas potential!", "Getting Brexit done \n50,000 more nurses \n50 million more GP surgery appointments\n20,000 more police\nTougher sentencing for criminals\nAn Australian style, points-based immigration system\nTackling climate change \nLowering your taxes \nStrengthening our economy", "We \u06eave got the plan to get Brexit done and invest in our NHS, schools and police. \n\nWe will get Parliament working again on the issues that matter to you.", "Together we can get Brexit done. \nVote Conservative on December 12th.", "Folks, we \u06eare having this election because Parliament simply wasn \u06eat working - it was stuck in endless dither and delay. \n\nThe only way we can move forward now is to get Brexit done with a majority Conservative government.", "We have 9 days to get Brexit done and unleash the potential of the whole UK!", "Let \u06eas get Brexit done and get to work on the things that matter to you.", "We can \u06eat afford another chaotic hung parliament     with Jeremy Corbyn in charge of nothing except more arguments. So let \u06eas get Brexit done. Let \u06eas get on with the country \u06eas priorities and unleash the potential of the whole of the UK.", "We \u06eare having this election because Parliament could not get anything done. It was paralysed. \n\nIt \u06eas time for us to take decisive action and to get Brexit done, so that we can get Parliament working again on the issues that matter to you.", "Getting Brexit done \n20,000 new police \nMore money for our NHS \nMore money for every pupil \nAn Australian style, points-based immigration system \n\n#VoteConservative #ITVDebate", "The terrible Khan case has highlighted a complicated area of law. There have been many inaccuracies reported about this case over the last 24 hours. Here are the details (1/16)", "Happy #StAndrewsDay to all Scots across Scotland, the UK and the world today. \n\nI'm proud to be the Prime Minister of the entire United Kingdom, including Scotland.", "I want to thank the emergency services and members of the public for their immense bravery in responding to this suspected terrorist attack at London Bridge.\n \nThis is an appalling incident and all my thoughts are with the victims and their families.", "\"I \u06eam being kept updated on the incident at London Bridge and want to thank the police and all emergency services for their immediate response.\"     Prime Minister Boris Johnson", "We can \u06eat afford another chaotic hung parliament     with Jeremy Corbyn in charge of nothing except more arguments. \n\nSo let \u06eas get Brexit done. Let \u06eas get on with the country \u06eas priorities and unleash the potential of the whole of the UK.", "Back me to get Brexit done - vote Conservative on December 12th!"], "targets": null, "hoffset": 10, "voffset": 10}]});

902], [0.8243286019188341, 0.6795913385312966], [0.1519238691768271, 0.17177208224139978], [0.7572183393494534, 0.8859071445932725], [0.5633396889863272, 0.8715995432101273], [0.6303362376977781, 0.8520481632439209], [0.6516750789940171, 0.8598463841856282], [0.7407502131791872, 0.839848163607252], [0.6248038172915626, 0.8581149639853972], [0.3882849697844002, 0.055231903833993005], [0.1073150260316802, 0.40617187644497793], [0.2742454515083549, 0.4016827777982032], [0.3862709147682434, 0.543457627193758], [0.6303362376977781, 0.8520481632439209], [0.6164271277697702, 0.8890329899550878], [0.548982245053989, 0.10577955126323525], [0.2842535598877396, 0.33008546412970324], [0.5918689035982749, 0.8156784667469426], [0.11335975919787833, 0.09444870197127933], [0.6664320436999387, 0.8164772103313762], [0.6779950366154263, 0.8194200974225945], [0.7136135994565893, 0.637379721532738], [0.5092993081781051, 0.34604819418927507], [0.17508034064869915, 0.02279749533151856], [0.39318102336665917, 0.46821478595214305], [0.3198157761919401, 0.9122882678059198], [0.20332965885767484, 0.7452034997792304], [0.17453087478287532, 0.6075959179606152], [0.7136135994565893, 0.637379721532738], [0.5918689035982749, 0.8156784667469426]]}, "id": "el9972140209047263792", "plugins": [{"type": "reset"}, {"type": "zoom", "button": true, "enabled": false}, {"type": "boxzoom", "button": true, "enabled": false}, {"type": "htmltooltip", "id": "el9972140207835963696", "labels": ["Racist thuggery has no place on our streets. Anyone attacking the police will be met with full force of the law. These marches & protests have been subverted by violence and breach current guidelines. Racism has no part in the UK and we must work together to make that a reality.", "The statue of Winston Churchill in Parliament Square is a permanent reminder of his achievement in saving this country     and the whole of Europe     from a fascist and racist tyranny. 1/8", "We must all continue to remember those on the frontline battling this disease, and members of society who are vulnerable - and continue to do all we can to stop the spread of coronavirus. \n \nBy doing the right thing and following the rules, you are helping to save lives.", "I want to say thank you, from the bottom of my heart, to all carers in the UK helping us through this pandemic. \n \nWhether you work as a carer, or are caring for someone at home, your compassion and strength at this time is a beacon of hope for us all. \n \n #CarersWeek", "People have a right to protest peacefully & while observing social distancing but they have no right to attack the police. These demonstrations have been subverted by thuggery - and they are a betrayal of the cause they purport to serve. Those responsible will be held to account.", "If you have coronavirus symptoms (a high temperature, a new continuous cough, or a loss or change to sense of taste or smell) you need to self-isolate and get tested.\n\nThere is plenty of capacity and anyone with symptoms is eligible. Order a test from http://nhs.uk/coronavirus   1/2", "Whilst we are all rightly focused on beating coronavirus, we cannot lose sight of the need to protect our people and our planet from the devastating threat of climate change and biodiversity loss if nothing is done. 1/4", "At the start of #PrideMonth, I want to thank those in the LGBT community and campaigners for their inspirational work, in fighting tirelessly to overcome the prejudices many face. \n\nYour contribution has helped shape a better future for people in the UK and around the world.", "From today, in England, you will be allowed to meet up to five friends in public outdoor places or in your garden. This will be a moment of joy and relief for many. \n\nPlease remember to keep 2 metres away from those you don \u06eat live with, and wash your hands regularly.", "Have you got symptoms of coronavirus? \n\nIf so, you must get tested. Click below ", "On International Day of UN Peacekeepers, I want to pay my tribute to the Blue Helmets and many others who do so much to bring peace in areas of the world torn apart by conflict. \n\n#PKDay", "From Monday we will allow up to six people to meet outside, provided those from different households continue strictly to observe social distancing rules by staying two metres apart. (1/3)", "The NHS Test and Trace service will now start emailing, phoning and texting people who have been in close contact with confirmed coronavirus cases.\n\nThe team will call from: 0300 013 5000\nOR send a text message from    NHS \u06dd", "Seven years on from his murder on a London street, we remember Fusilier Lee Rigby. On this sad day, my thoughts are with his family, friends and colleagues.", "Today, on the third anniversary of the Manchester Arena attack, we remember the 22 lives which were so cruelly taken. My thoughts are with all of those grieving for the loss of their loved ones.", "I know this has been a tough time for so many people. Thank you for all of the sacrifices you have made. \n\nWe are past the peak, and I \u06eam confident that if we continue to follow the rules and work together, we will beat this virus and be reunited with our friends and family soon.", "The common sense of the British people got us through that first phase of this disease. I am absolutely confident it will get us through the next as well. #StayAlert", "There could be no greater mistake than to jeopardise everything we have striven to achieve by proceeding too far and too fast. \n\nWe must all continue to #StayAlert, so that we can control the virus and save lives.", "We can control the virus if we all #StayAlert:\n\n Stay home as much as possible\n Work from home if you can\n Limit contact with others \n Keep your distance if you go out\n Wash your hands\n Self-isolate if you or anyone in your household has symptoms", "Thank you for all you are doing to protect our NHS and save lives. \n\nThis bank holiday weekend, please stay at home, so we don \u06eat undo everything that \u06eas been done so far.", "We are past the peak of this disease. But we can \u06eat get complacent.\n \nPlease continue to follow the rules on social distancing and stay at home to save lives. \n \n#StayHomeSaveLives", "This has been a difficult time for our country, but if we all continue to follow the rules and protect our NHS, then we can beat this virus together. \n\n#StayHomeSaveLives", "Millions of people across this country have been doing the right thing: going through the hardship of self-isolation, faithfully, patiently, with thought and care for others as well as for themselves. \n \nThank you for all you are doing, and please keep going. \n\n#StayHomeSaveLives", "Thank you to all the midwives across the UK who continue to show extraordinary kindness and courage during these challenging times. Your compassion, care and expertise are needed now more than ever. #IDM2020", "The race to discover the vaccine to defeat this virus is not a competition between countries, but the most urgent shared endeavour of our lifetimes.\n\nIt \u06eas humanity against the virus - we are in this together, and together we will prevail.", "There are five key tests that we must satisfy before we can adjust the current measures. - 1/6", "I can confirm that we are past the peak of this disease. \n\nWe are past the peak and we are on the downward slope.\n \nAnd we have so many reasons to be hopeful for the long term. \n\nBut we can only defeat coronavirus by our collective discipline and working together.", "1/3: I know how hard and how stressful it has been to give up even temporarily those ancient and basic freedoms, not seeing friends, not seeing loved ones, working from home, managing the kids, worrying about your job and your firm.", "Last night, on the advice of my doctor, I went into hospital for some routine tests as I \u06eam still experiencing coronavirus symptoms. I \u06eam in good spirits and keeping in touch with my team, as we work together to fight this virus and keep everyone safe.", "Thank you to everyone who is saving lives by staying at home this weekend. \n\nI know it's tough, but if we all work together and follow the guidance we will beat #coronavirus.\n\n#StayHomeSaveLives", "I have just spoken to @Keir_Starmer & congratulated him on becoming Labour leader. We agreed on the importance of all party leaders continuing to work constructively together through this national emergency. I have invited him and other opposition leaders to a briefing next week.", "This country has made a huge effort, a huge sacrifice, and done absolutely brilliantly well in delaying the spread of the virus. \n\nBut in this fine weather, please don't be tempted to break the regulations. I urge everyone to stay at home, protect the NHS and save lives.", "Yesterday's data showed more people were using transport than in previous days. \n\nPlease do not leave your house unless absolutely necessary. It really will save lives. \n\n#StayHomeSavesLives", "I'm staying at home to protect our NHS and save lives.\n\nIf we all follow government advice, we can beat #coronavirus together.\n\n#StayHomeSaveLives", "Thank you to the 20,000 former staff coming back to the NHS.\n\nAnd thank you to the 750,000 people who have volunteered to help vulnerable people through this crisis.\n\nWe will get through it together.\n\n#Coronavirus #StayHomeSaveLives", "We \u06eare taking the right measures at the right time. It is vital to slow the spread of the disease, so stay at home, protect the NHS and save lives. #StayHomeSaveLives", "Thank you to the 11,788 former NHS staff who have answered the call to support the health service as it responds to #coronavirus.\n\nNow people must stay at home to support you, so that you can be there to support us in our hour of need. #StayHomeSaveLives", "If you don \u06eat follow these instructions, you are putting people \u06eas lives at risk: \n\nYou must stay at home to protect our NHS and save lives. \n\n#StayHomeSaveLives", "We will get through this together, and we will beat the virus. \n\nTo win this fight, we need everyone to follow our advice: as far as possible, we want you to stay at home. The more effectively everyone does this, the faster this country will recover.\n\n#StayHomeSaveLives", "We can send #coronavirus packing in this country, but only if we take the required steps to reduce the peak.\n\nOnce we \u06eave achieved that, then the scientific progress that we are making will really come into play.\n\n1/5", "I want to say a huge thank you on behalf of the whole country to everyone working in our NHS, of every specialism and role, in our fight against the coronavirus pandemic. We \u06eave never needed you more than we do today.", "The government and the NHS have updated the advice on #COVID19.\n \nIf you have: a new continuous cough OR a high temperature (37.8 degrees or higher), you should stay at home for 7 days.\n \nRead the full guidance now:\n http://NHS.uk/coronavirus  ", "It is with deep sadness that I learned that a UK soldier was killed in the attack at the Taji military base last night. My thoughts go out to their loved ones at this extremely difficult time.", "Help protect yourself and others.\n \nTap the link below to share official #NHS advice on #coronavirus with your family and friends via @WhatsApp \n\nShare now ", "Today, two years on from the chemical attack in Salisbury, my thoughts remain with all those impacted. It is heartening to see the historic city welcoming visitors and looking to the future, thanks to the strength and character of the community.", "I'm deeply saddened to hear of the attack at the London Central Mosque. It's so awful that this should happen, especially in a place of worship. My thoughts are with the victim and all those affected.", "My thoughts are with the people of Germany as they grieve those lost in the terrible attack in Hanau last night. \n\nThe UK stands with our German friends against this racist assault on our values.", "This morning I spoke to Chinese President Xi to express my sympathy and support for those affected by the coronavirus outbreak. The UK government has donated vital medical equipment to the region and we will continue to offer our assistance. (1/2)", ".@KarenPierceUN is an outstanding and accomplished diplomat and I can think of no better person to drive forward our hugely important relationship with the United States at this time. I \u06eam delighted she \u06eall be representing us in Washington.", "Thank you to all emergency services responding to the incident in Streatham, which the police have now declared as terrorism-related. My thoughts are with the injured and all those affected.", "Thank you to @SteveBarclay, @LordCallanan, @JamesDuddridge and to everyone at DExEU for all of your hard work and dedication in getting Brexit delivered.", "Tonight we have left the EU - an extraordinary turning point in the life of this country. Let us come together now to make the most of all the opportunities Brexit will bring - and let \u06eas unleash the potential of the whole UK. ", " What: The Prime Minister's Address to the Nation.\n When: 10pm tonight.\n Where: @BorisJohnson's Facebook page.\n\n#BrexitDay", "This Australia Day, I want all our Aussie friends to know that we Brits are thinking of you. Your resilience & positive spirit has been an inspiration to us all. \n \nOur two nations share a very special friendship that I hope will continue to strengthen. Happy Australia Day.", "Seamus Mallon made an extraordinary contribution to democracy and peace in Northern Ireland. I want to express my sincere condolences to his daughter Orla, to his family and friends and to the SDLP.", "The Withdrawal Agreement has received  Royal Assent and is now law. We will leave the EU on January 31st ", "RIP Sir Roger Scruton. We have lost the greatest modern conservative thinker - who not only had the guts to say what he thought but said it beautifully.", "This is a great step forwards for the people of Northern Ireland and for restoring public confidence in stable devolved Government and delivering much needed reforms to public services.", "\"My thoughts are with the prison staff who were injured in the suspected terrorist incident at HMP Whitemoor and I would like to thank them, and the emergency services, for their courageous response.  We owe those who keep us safe a huge debt of gratitude.\"     PM  @BorisJohnson", "Our hearts go out to all those in Australia affected by these devastating fires. I have been in touch with PM @ScottMorrisonMP to offer any assistance we can provide. We stand with you at this very difficult time. ", "We are going to level up and unite our country. We are going to get Brexit done and deliver the change that people voted for. And we are going to protect and invest in our amazing NHS.", "We will be out of the EU on 31st January. We will invest billions more in our NHS. We will level up and unite our country. #PeoplesGovernment", "Wishing you and your family a very Merry Christmas", "The second reading of the Withdrawal Agreement Bill has passed - which means we are one step closer to getting Brexit done ", "We will be out of the EU on 31st January. We will invest billions more in our NHS. We will level up and unite our country. #PeoplesGovernment", "Let's unite this country, let's spread opportunity to every corner of the UK, with superb education, superb infrastructure, and technology.\n\nLet's get this done and move forward.", "We are going to deliver a Parliament that works for the people.", "I say thank you for the trust you have placed in us, and in me. \n\nWe will work round the clock to repay your trust and to deliver on your priorities with a parliament that works for you.", "Let \u06eas not go back to the broken parliament we had before this election was called. \n\nLet \u06eas move forward with a majority Conservative government that can get things done.", "Vote Conservative to get Brexit done! ", "We are a great country, and we can be greater still. \n\nVote today to get Brexit done. \n\nVote Conservative.", "Vote Conservative today to get Brexit done!", "Vote to get Brexit done and unleash Britain \u06eas potential. Vote Conservative.", "We must respect the result of the EU referendum. #VoteConservative", "Today is our chance to get Brexit done. Vote Conservative.", "If there \u06eas a Conservative majority government, we can deliver the change people voted for. We can get Brexit done. We can make a decisive break with the dither and indecision of the last three and a half years. We can unleash Britain \u06eas potential.", "Let \u06eas get Brexit done and get on with spreading opportunity and hope across the whole UK and let \u06eas unleash the potential of this country.", "We have one more day. Make sure you have your voice heard. Vote to honour the promises of the past and for a brighter vision of the future. Vote Conservative tomorrow.", "There are only two more days to go. Let \u06eas get Brexit done!", "We \u06eare having this election because Parliament couldn \u06eat get anything done. Only the Conservatives can get Brexit done and get Parliament working again, on the issues that matter to you.", "Jonathan Ashworth is saying what hundreds of Labour candidates and millions of voters are thinking. Jeremy Corbyn is unfit to be PM because he is blocking Brexit. \n\nOnly a vote for @Conservatives will break the deadlock & #GetBrexitDone so we can focus on the people \u06eas priorities.", "Let \u06eas get Brexit done. Let \u06eas get on with the country \u06eas priorities and unleash the potential of the whole of the UK.", "Let's get Brexit done!", "Let's get Brexit done!", "We live in a great country, and we can make it greater still. \n\nTogether we \u06eall end the uncertainty and get Brexit done.", "We can \u06eat afford another chaotic hung parliament     with Jeremy Corbyn in charge of nothing except more arguments. \n\nSo let \u06eas get Brexit done. Let \u06eas get on with the country \u06eas priorities and unleash the potential of the whole of the UK.", "As Prime Minister, I will always back our security services, our police and our troops. I will give them the funding and support they need. #BBCDebate", "We will toughen up sentencing for terrorists     increasing the minimum sentence for serious offenders and ending early release completely #BBCDebate", "If you work hard to provide for your family and pay your taxes, you should be able to keep a bit more of what you earn.\n \nA Conservative government will keep your taxes low - not take more away. #BBCDebate", "We \u06eave got 6 days to get Brexit done! Let \u06eas do it.", "Folks, we have just six days to get Brexit done and move this country forward. Together, we \u06eall get there.", "Let \u06eas get Brexit done and focus our hearts and minds on the priorities of the British people.", "We will get Brexit done.", "Let's get Brexit done ", "Let \u06eas get Brexit done and deliver on the priorities of the British people.", "Under my leadership, a majority Conservative government will get Brexit done, invest more money in our public services, get tough on crime, back our Armed Forces and strengthen our economy.", "Folks, every vote is going to count at this election. You can use yours to put an end to the uncertainty and to get Brexit done!", "If there \u06eas a Conservative majority government, we can deliver the change people voted for. We can get Brexit done. We can make a decisive break with the dither and indecision of the last three and a half years. We can unleash Britain \u06eas potential.", "The only way we can break the deadlock in parliament - and get Brexit done - is with a majority Conservative government.", "Let \u06eas get Brexit done so we can focus our hearts and our minds on the priorities of the British people.", "We \u06eave got 8 days to get Brexit done and unleash Britain \u06eas potential!", "Getting Brexit done \n50,000 more nurses \n50 million more GP surgery appointments\n20,000 more police\nTougher sentencing for criminals\nAn Australian style, points-based immigration system\nTackling climate change \nLowering your taxes \nStrengthening our economy", "We \u06eave got the plan to get Brexit done and invest in our NHS, schools and police. \n\nWe will get Parliament working again on the issues that matter to you.", "Together we can get Brexit done. \nVote Conservative on December 12th.", "Folks, we \u06eare having this election because Parliament simply wasn \u06eat working - it was stuck in endless dither and delay. \n\nThe only way we can move forward now is to get Brexit done with a majority Conservative government.", "We have 9 days to get Brexit done and unleash the potential of the whole UK!", "Let \u06eas get Brexit done and get to work on the things that matter to you.", "We can \u06eat afford another chaotic hung parliament     with Jeremy Corbyn in charge of nothing except more arguments. So let \u06eas get Brexit done. Let \u06eas get on with the country \u06eas priorities and unleash the potential of the whole of the UK.", "We \u06eare having this election because Parliament could not get anything done. It was paralysed. \n\nIt \u06eas time for us to take decisive action and to get Brexit done, so that we can get Parliament working again on the issues that matter to you.", "Getting Brexit done \n20,000 new police \nMore money for our NHS \nMore money for every pupil \nAn Australian style, points-based immigration system \n\n#VoteConservative #ITVDebate", "The terrible Khan case has highlighted a complicated area of law. There have been many inaccuracies reported about this case over the last 24 hours. Here are the details (1/16)", "Happy #StAndrewsDay to all Scots across Scotland, the UK and the world today. \n\nI'm proud to be the Prime Minister of the entire United Kingdom, including Scotland.", "I want to thank the emergency services and members of the public for their immense bravery in responding to this suspected terrorist attack at London Bridge.\n \nThis is an appalling incident and all my thoughts are with the victims and their families.", "\"I \u06eam being kept updated on the incident at London Bridge and want to thank the police and all emergency services for their immediate response.\"     Prime Minister Boris Johnson", "We can \u06eat afford another chaotic hung parliament     with Jeremy Corbyn in charge of nothing except more arguments. \n\nSo let \u06eas get Brexit done. Let \u06eas get on with the country \u06eas priorities and unleash the potential of the whole of the UK.", "Back me to get Brexit done - vote Conservative on December 12th!"], "targets": null, "hoffset": 10, "voffset": 10}]});
